  Platforms From Coastal Waters of California from 19750701 to 19780930 (NODC Accession
  8700332)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
