  \"cas-chemical-abstracts-society-parameter-codes-and-other-data-from-fixed-platform-and-other-pla\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These data are part of the Southern California
  OCS Baseline Study fundednby BLM and submitted by Science Applications, Inc. Coastal
  areas alongnsouthern California were sampled. Following is a list of purpose fornwhich
  the study was conducted, the period when the data was collectednand the type of
  data collected.nnSampling was done from July 1, 1975 to November 6, 1977 to obtain
  depth,ntemperature and salinity profiles. During the same time period data wasncollected
  to measure the amounts of particulate organic carbon (poc),ndissolved organic carbon
  (doc), and ATP.nnAnalysis was done for intertidal hydrocarbon (hc) concentrations
  fromnJuly 1, 1975 to June 30, 1978. Fractions analyzed include aliphatic andnaromatics,
  pristane and phytane, iso-n and branched hydrocarbons,nodd/even preference, and
  the hexane, benzene and methane fractions.nnAnalysis was done for benthic hydrocarbon
  (hc) concentrations from Julyn1, 1975 to November 6, 1977. Fractions analyzed include
  aliphatic andnaromatics, pristane and phytane, iso-n and branched hydrocarbons,nodd/even
  preference, and the hexane, benzene and methane fractions.nnSampling was done to
  assess the trace metal concentrations from July 1,n1975 to November 6, 1978. Benthic
  fauna, sediments and the water columnnwere analyzed for Ba, Cd, Cr, Cu, Fe, Ni,
  Pb, V, Zn and Alnconcentrations.nnSampling was done to assess the trace metal concentrations
  from July 1,n1975 to November 6, 1978. Intertidal rocky and sandy fauna, andnsediments
  were analyzed for Ba, Cd, Cr, Cu, Fe, Ni, Pb, V, Zn and Alnconcentrations.nnBenthic
  coastal sediments along southern California were sampled fromnJuly 1, 1975 to November
  6, 1977. The analysis includes sediment age,ngrain size, total organic carbon (toc),
  total inorganic carbon (tic),ntotal carbon (tc), calcium carbonate content and mineral
  composition, asnwell as a description of the field conditions during sampling. Identicalnanalysis
  was conducted on samples collected during July 1, 1975 to Junen30, 1978.nnIntertidal
  coastal sediments along southern California were sampled fromnJuly 1, 1975 to June
  30, 1978. The analysis includes sediment age, grainnsize, total organic carbon (toc),
  total inorganic carbon (tic), totalncarbon (tc), calcium carbonate content and mineral
  composition, as wellnas a description of the field conditions during sampling.nnCoastal
  areas along southern california were sampled from July 1, 1976nto June 30, 1978
  and the composition of the benthic microfauna andnbenthic macrofauna was analyzed.nnCoastal
  areas along southern California were sampled from July 1, 1975nto June 30, 1978.
  Data includes files describing the biotic/abioticnmussel community and a species
  dictionary as well as a description ofnthe field conditions.nnRocky coastal beaches
  along southern California were sampled from Julyn1, 1975 to June 30, 1978 and the
  composition of the intertidal rockynfauna was analyzed. Included in these data is
  a file on rocky intertidalnfauna succession and a description of the field conditions.nnSandy
  coastal beaches along southern california were sampled from uly 1,n1975 to June
  30, 1978 and the composition of the sandy intertidal faunanwas analyzed.\",\n\t\"license_title\":
